import React from 'react';
import './App.css';
import SmallText from './components/SmallText.js';
import TextButton from './components/TextButton.js';
import DspButton from './components/DspButton.js';
import SwitchButton from './components/SwitchButton.js';
import NumberInput from './components/NumberInput.js';
import TabGroup from './components/ButtonGroup.js';

class SpacingPage extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            streamNumber: null,
            role: null,
            recordDeal: [],
            publishDeal: [],
            sliderValue: null,
            recordDealSelected: null,
            publishingDealSelected: null,
            advance: null
        };

    }

    render() {
      return (
        <div style={{display: 'flex'}}>
            <div style={{width: '33.33%', flexDirection: 'column'}}>
              <div style={{backgroundColor: 'yellow'}}>
                <SmallText text="top left" />
              </div>
              <div style={{backgroundColor:'pink'}}>
                <SmallText text="middle left" />
              </div>
            </div>
            <div style={{width: '33.33%', backgroundColor: 'red'}}>
              <SmallText text="top middle" />
            </div>
            <div style={{width: '33.33%', backgroundColor: 'orange'}}>
              <SmallText text="top right" />
            </div>
        </div>
        )
    }
  }

  export default SpacingPage;
